	$("form").on('submit', function(event){
		$this = $(this);
		event.preventDefault();
		var id = $(this).attr('id');
		var message = $('.notification');
		var download = $this.find("button[type='submit']").attr('data-download');
		$.ajax({
			cache:false,
			type:"POST",
			url:"call.php",
			data:$this.serialize(),
			success:function(data) {
				if(data == 'true') {
					$this.trigger("reset");
					message.text('  ');
					message.addClass('active success');
					setTimeout(function(){
						message.removeClass('active success');
					}, 4000);
					/*if(download) {
						var link = document.createElement('a');
						link.setAttribute('href',download);
						setTimeout(function(){
							link.click();
						}, 4500);
					}*/
					ym(50290417,'reachGoal', 'send_' + id);
					gtag('event',' ', {'event_category' : id});
				} else {
					var output = '';
					var error = JSON.parse(data); 
					for(var i = 0; i < error.length; i++) {
						output += '<li>'+error[i]+'</li>';
					}
					message.html(output);
					message.addClass('active error');
					setTimeout(function(){
						message.removeClass('active error');
					}, 4000);
				}
			}
		})
	})

